script: |
  super -f text -I q8365.spq | sort > q8365.out

inputs:
  - name: q8365.spq
    data: |
      SELECT DISTINCT col2 + col2 AS col2 FROM tab0 (FORMAT parquet) WHERE ( col1 * ( col0 * col1 ) ) NOT BETWEEN NULL AND + ( col1 );
  - name: tab0

outputs:
  - name: q8365.out
    data: |
      198
      20
      94
